    data: |
      SELECT + col2 * + - ( - 89 ), + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE + col0 NOT BETWEEN + 83 AND - 78;
  - name: tab1

outputs:
  - name: q8731.out
    data: |
      5251	85
      6052	91
      8544	51
